import React, { useState } from 'react';
import axios from 'axios';
import styled from 'styled-components';

const FormContainer = styled.div`
  max-width: 500px;
  margin: 0 auto;
  background: #fff;
  padding: 30px;
  border-radius: 12px;
  box-shadow: 0 0 12px rgba(0,0,0,0.1);
`;

const Input = styled.input`
  display: block;
  width: 100%;
  padding: 10px;
  margin-bottom: 15px;
  border-radius: 8px;
  border: 1px solid #ccc;
`;

const Button = styled.button`
  background-color: #3498db;
  color: white;
  padding: 12px 20px;
  border: none;
  border-radius: 8px;
  cursor: pointer;
`;

function HotelForm() {
  const [formData, setFormData] = useState({
    nom: '',
    description: '',
    prix: '',
    disponibilite: '',
    image: '' // URL de l’image après upload
  });

  const [file, setFile] = useState(null);

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleFileChange = e => {
    setFile(e.target.files[0]);
  };

  const handleSubmit = async e => {
    e.preventDefault();

    try {
      // 1. Upload de l’image
      let imageUrl = '';
      if (file) {
        const imageData = new FormData();
        imageData.append('image', file);

        const uploadRes = await axios.post('http://localhost:5000/api/hotels/upload', imageData);
        imageUrl = uploadRes.data.imageUrl;
      }

      // 2. Envoi des données de l’hôtel
      const hotelData = { ...formData, image: imageUrl };
      await axios.post('http://localhost:5000/api/hotels', hotelData);
      alert("✅ Hôtel enregistré avec succès !");
      setFormData({ nom: '', description: '', prix: '', disponibilite: '', image: '' });
      setFile(null);
    } catch (error) {
      console.error("❌ Erreur lors de l’enregistrement :", error);
      alert("Erreur lors de l’enregistrement de l’hôtel");
    }
  };

  return (
    <FormContainer>
      <h2>Ajouter un Hôtel</h2>
      <form onSubmit={handleSubmit}>
        <Input name="nom" placeholder="Nom" value={formData.nom} onChange={handleChange} required />
        <Input name="description" placeholder="Description" value={formData.description} onChange={handleChange} required />
        <Input name="prix" placeholder="Prix" value={formData.prix} onChange={handleChange} required />
        <Input name="disponibilite" placeholder="Disponibilité" value={formData.disponibilite} onChange={handleChange} required />
        <Input type="file" accept="image/*" onChange={handleFileChange} required />
        <Button type="submit">Enregistrer un hôtel</Button>
      </form>
    </FormContainer>
  );
}

export default HotelForm;
